import "./layout/Main.css";

const Main = () => {
  const imageUrl = encodeURI("/images/43_product_img0_돼지바.png");
  return (
    <>
      <div className="main_img"></div>
      <img src={imageUrl} alt="gd" />
    </>
  );
};

export default Main;
